import React from "react";
import { FaReact } from 'react-icons/fa';

function Footer() {
  class Question extends React.Component {
    render() {
      return <h3> Lets go for a <FaReact />? </h3>
    }
  }
  return (
    <footer>
      <hr />
      <p className="pull-right">
        React Google Books Search
      </p>

    </footer>
  );
}

export default Footer;
